import React from "react";
import {  Switch, Route, Redirect } from "react-router-dom";
import Login from "./Login";

function App()
{
    const adminUser = {
        
            email:"hruday@gmail.com",
            password: "hruday123"
           
    }

    return(
       
            <Switch>
                <Route exact path="/">
                </Route>
                <Route exact path="/Login" component={Login}/>
                <Route path="*" render={() => "404 Not found!"}/>
            </Switch>
   
    );
    
}


export default App;
